paramConversion.applyStepsToNormalizedParameterValue:
function applyStepsToNormalizedParameterValue(normalizedValue, steps) {
    if (steps == 1) {
        if (normalizedValue > 0) {
            normalizedValue = 1.;
        }
    } else {
        let oneStep = 1. / (steps - 1);
        let numberOfSteps = rnbo_fround(normalizedValue / oneStep * 1 / 1) * 1;
        normalizedValue = numberOfSteps * oneStep;
    }

    return normalizedValue;
}

paramConversion.convertToNormalizedParameterValue:
function convertToNormalizedParameterValue(index, value) {
    switch (index) {
    case 3:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));
            let normalizedValue = (value - 0) / (1 - 0);
            return normalizedValue;
        }
    case 1:
        {
            value = (value < 1 ? 1 : (value > 10 ? 10 : value));
            let normalizedValue = (value - 1) / (10 - 1);
            return normalizedValue;
        }
    case 0:
        {
            value = (value < 1 ? 1 : (value > 128 ? 128 : value));
            let normalizedValue = (value - 1) / (128 - 1);
            return normalizedValue;
        }
    case 5:
        {
            value = (value < 50 ? 50 : (value > 4000 ? 4000 : value));
            let normalizedValue = (value - 50) / (4000 - 50);
            return normalizedValue;
        }
    case 2:
    case 4:
        {
            value = (value < 0.25 ? 0.25 : (value > 3 ? 3 : value));
            let normalizedValue = (value - 0.25) / (3 - 0.25);
            return normalizedValue;
        }
    case 6:
        {
            value = (value < 0.01 ? 0.01 : (value > 20 ? 20 : value));
            let normalizedValue = (value - 0.01) / (20 - 0.01);
            return normalizedValue;
        }
    default:
        return value;
    }
}

paramConversion.convertFromNormalizedParameterValue:
function convertFromNormalizedParameterValue(index, value) {
    value = (value < 0 ? 0 : (value > 1 ? 1 : value));

    switch (index) {
    case 3:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 0 + value * (1 - 0);
            }
        }
    case 1:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 1 + value * (10 - 1);
            }
        }
    case 0:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 1 + value * (128 - 1);
            }
        }
    case 5:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 50 + value * (4000 - 50);
            }
        }
    case 2:
    case 4:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 0.25 + value * (3 - 0.25);
            }
        }
    case 6:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 0.01 + value * (20 - 0.01);
            }
        }
    default:
        return value;
    }
}

paramConversion.constrainParameterValue:
function constrainParameterValue(index, value) {
    var v = value;

    switch (index) {
    case 0:
        {
            v = (v > 128 ? 128 : (v < 1 ? 1 : v));
            return v;
        }
    case 1:
        {
            v = (v > 10 ? 10 : (v < 1 ? 1 : v));
            return v;
        }
    case 2:
        {
            v = (v > 3 ? 3 : (v < 0.25 ? 0.25 : v));
            return v;
        }
    case 3:
        {
            v = (v > 1 ? 1 : (v < 0 ? 0 : v));
            return v;
        }
    case 4:
        {
            v = (v > 3 ? 3 : (v < 0.25 ? 0.25 : v));
            return v;
        }
    case 5:
        {
            v = (v > 4000 ? 4000 : (v < 50 ? 50 : v));
            return v;
        }
    case 6:
        {
            v = (v > 20 ? 20 : (v < 0.01 ? 0.01 : v));
            return v;
        }
    default:
        return value;
    }
}
